            fName:"vanitha",
            lName:"ggg",
            email:"vanitha@gmail.com"
        }
    }

    return (
      <div>
<h1>{this.state.myName}</h1>
<h1>{this.state.myVillage}</h1>
      </div>
    )
  }
}
